INSERT INTO "public"."Task" ("id", "name", "counter", "slug", "sortOrder", "description", "startedAt", "finishedAt", "createdAt", "updatedAt", "statusType", "statusId", "assigneeId", "creatorId", "projectId", "sprintId", "userActionId", "milestoneId", "workspaceId", "teamId", "lastModifiedVersion", "deleted") VALUES
('tsk_cluimu3fg000o3j6aaapekefr', 'Twitter announcement', 6, 'twitter-announcement', 'a4', '{"type": "doc", "content": [{"type": "paragraph", "content": [{"text": "I’m happy to announce Makkuro, a new tool that combines a Helpdesk and an Issue Tracker for your startup🎉!", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "It all started about a year ago when James, our head of support at Clerk, asked me where to store the user feedback that he had been gathering from Intercom, and my instinctive answer was “we were going to set up a process to gather the feedback in X tool and then we’ll parse it to generate opportunities, blah blah blah”. ", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "The moment I wrote these words I immediately felt horrible.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "This process might work in large enterprises where the wrong direction is costly and the amount of feedback is indeed overwhelming, but for the majority of startups it’s just useless gatekeeping that ends up storing useful information away in a tool and demotivates people from adding to it.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "The alternative was to put this information in Linear but everyone, including me, were horrified by this — “Linear is a Delivery Tool” was my battle cry against using an issue tracker for feedback storage.", "type": "text"}, {"type": "hardBreak"}, {"text": "But then I wondered: what would it look like if I actually built a tool like that?", "type": "text"}]}, {"type": "bulletList", "content": [{"type": "listItem", "content": [{"type": "paragraph", "content": [{"text": "What if you could jump from a task to the connected customer conversation that spawned it, without having to sign into another tool?", "type": "text"}]}]}, {"type": "listItem", "content": [{"type": "paragraph", "content": [{"text": "What if you could prioritize these tasks based on the number of requests it has?", "type": "text"}]}]}, {"type": "listItem", "content": [{"type": "paragraph", "content": [{"text": "What if you measured velocity in “time from feedback to deployment” instead of just an esoteric definition of lead and cycle time?", "type": "text"}]}]}, {"type": "listItem", "content": [{"type": "paragraph", "content": [{"text": "What if you ended up paying much less $$ for these two tools in your workflow?", "type": "text"}]}]}]}, {"type": "paragraph", "content": [{"text": "Thus, ", "type": "text"}, {"text": "makkuro.app", "type": "text", "marks": [{"type": "link", "attrs": {"rel": "noopener noreferrer nofollow", "href": "http://makkuro.app", "class": null, "target": "_blank"}}]}, {"text": " came to life! I decided to merge these two seemingly irrelevant tools into one and it turns out, if you tilt your head a bit you can actually see how this fusion makes sense.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "This is the first step of a long journey that I’m excited to embark on and I need your help. For now, and the next 2-3 months, Makkuro is going to be free so if:", "type": "text"}]}, {"type": "bulletList", "content": [{"type": "listItem", "content": [{"type": "paragraph", "content": [{"text": "you are just starting your product journey and really valuate your customer feedback", "type": "text"}]}]}, {"type": "listItem", "content": [{"type": "paragraph", "content": [{"text": "you are part of a small, fully autonomous and modern team", "type": "text"}]}]}, {"type": "listItem", "content": [{"type": "paragraph", "content": [{"text": "you are frustrated by the jumping back n forth between linear and intercom/plain, the opening of new seats, the added costs of these tools", "type": "text"}]}]}]}, {"type": "paragraph", "content": [{"text": "then sign up to the beta and try to use Makkuro for your team’s needs. After the beta period, the price is going to be 19$/user/month.", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "You can read more in the announcement blog post 👇", "type": "text"}]}, {"type": "paragraph", "content": [{"text": "https://www.makkuro.app/blog/introducing-makkuro", "type": "text", "marks": [{"type": "link", "attrs": {"rel": "noopener noreferrer nofollow", "href": "https://www.makkuro.app/blog/introducing-makkuro", "class": null, "target": "_blank"}}]}]}]}', NULL, NULL, '2024-04-02 17:07:44.521', '2024-04-03 13:09:29.927', 'completed', 'sts_cluimgomv002k1trqantcga9z', 'user_2eYFF6HU5UifB83i6HJCKHjvZ5R', 'user_2eYFF6HU5UifB83i6HJCKHjvZ5R', 'prj_cluimnmbp00153j6az3th5q1t', NULL, NULL, NULL, 'org_2eYMPjbv85aFYEBQmivNPgVCCxP', 'tm_cluimgomv00201trq4lmxa2iq', 88, 'f');
